import React, { Component } from "react";
import headshot from './headshot.jpg';


class About extends Component{
    render () {
        return(
            <section id='about'>
                <h1>All About McKayla </h1>
                <img src={headshot} class="img-fluid img-thumbnail" alt="..." />
                <h2>Work</h2>
                <h2>Play</h2>

            </section>
        );
    }
}

export default About;
